import React from 'react'
import List from '../components/List'
import { useOutletContext } from 'react-router-dom'
function Movie() {
  const {dispatch , movies} = useOutletContext()
  console.log(movies)
  return (
    <>
      <div className='list'>
          <div className='list-image'>Movies</div>
          <List type="movie"/>
      </div>
    </>
  )
}

export default Movie
